import "./App.css";

function App() {
  return (
    <div className="flex h-screen bg-pink-100">
      <SideBar />
      <div className="flex flex-col flex-1">
        <Welcome />
        <MoodTracker />
        <Explore />
      </div>
      <div className="flex flex-col mx-5">
        <Quote />
        <Music />
      </div>
    </div>
  );
}
function SideBar() {
  return (
    <div className="h-full bg-purple-400 px-5 mr-10 ">
      <h1>SideBar</h1>
    </div>
  );
}
function Welcome() {
  return (
    <div className="py-5 px-2 bg-pink-400 h-1/5 my-5 rounded-lg">
      <h1 className="text-center font-bold text-3xl text-white">
        Welcome Yashika!
      </h1>
      <p className="text-center text-white">Let's make your day! :)</p>
    </div>
  );
}
function MoodTracker() {
  return (
    <div className="bg-green-300 h-1/5 my-5 rounded-lg">
      <h1>Mood Tracker!</h1>
    </div>
  );
}

function Quote() {
  return (
    <div className="bg-yellow-300 h-1/2 px-60 my-5 rounded-lg">
      <h1>Quote</h1>
    </div>
  );
}
function Music() {
  return (
    <div className="bg-red-500 h-1/2 mt-5 rounded-t-lg">
      <h1>Music</h1>
    </div>
  );
}
function Explore() {
  return (
    <div className="bg-blue-200 h-screen mt-5 rounded-lg">
      <h1>Explore Today!!</h1>
    </div>
  );
}
export default App;
